const Navegation = () =>{
    return(
        <div>
            <h1>Leônidas Luigy Lima de Freitas</h1>
            <h3>E-mail: leonidas200999@hotmail.com </h3>
            <h3><a href="https://github.com/leoLUIGY">github: https://github.com/leoLUIGY</a></h3>
            <h3><a href="https://www.linkedin.com/in/le%C3%B4nidas-luigy-lima-freitas/">
            Linkedin: https://www.linkedin.com/in/le%C3%B4nidas-luigy-lima-freitas/</a></h3>
            <h3>Desenvolvedor de Jogos.</h3><br/>


            <h2>Formação Acadêmica</h2>
            <h3>Jogos Digitais – Fatec – Cursando: 6º Semestre</h3><br/>


            <h2>Cursos Complementares</h2>
            <h3>Inglês - Open English – Cursando – 6° Unidade</h3><br/>



            <h2>Histórico Profissional</h2>
            <h3>Arim Componentes</h3>
            <h3>Jovem Aprendiz – Administrativo 12/2017 a 11/2018</h3>
            <h3>Funções exercidas: Movimentação de dados; Elaboração e atualização de planilhas e gráficos;
            Participação em reuniões estratégicas com avaliação de desempenho de produção Dário, Mensal e Anual.</h3> 
            <br />

            <h2>Habilidades</h2>
            <h3>Conhecimentos relacionados a lógica de programação em Scratch;
            Python; Java; JavaScript; C#(desenvolvendo para Unity); HTML; CSS;
            BootStrap; Engenharia de Software.</h3> 
        </div>
    )
}

export default Navegation;
